export default () => (
  <Layout>
    <Header>
      <Row justify="space-around" type="flex">
        <Col span={20}>
          <Row justify="space-around" type="flex">
            <Col span={12} md={12} xs={24}>
              <span >Welcome to ABC Burger</span>
            </Col>
            <Col span={12} md={12} xs={0}>
              <span className="ml-30 float-right"><Icon type="phone" theme="filled" /> Call us 09-999-9999</span>
            </Col>
          </Row>
        </Col>
      </Row>
    </Header>
  </Layout>
